import React from 'react';
import Button from './Button';

function Buttons(props) {
    return (
        <>
            <h1>Button</h1>
            <Button size="l" type="primary">라지이잉</Button>
            <Button size="m" type="primary">Medium</Button>
        </>
    );
}

export default Buttons;
